import React, { useContext, useState, useEffect } from "react";
import { Link, useNavigate } from "react-router-dom";
import { ThemeContext } from "../../hooks/DarkMode/DarkModeContext";
import { UserContext } from "../../hooks/UserHooks/userContextApp";
import { toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
import MenuIcon from "@mui/icons-material/Menu";
import SunIcon from "../Navbar/ImagesNavBar/Sunny.png";
import MoonIcon from "../Navbar/ImagesNavBar/Moon.png";
import SearchIcon from "../Navbar/ImagesNavBar/SearchIcon.png";
import Jobs from "../Navbar/ImagesNavBar/Jobs.png";
import "../Navbar/Navbar.css";
import axios from "axios";

const NavBar = () => {
  const { isSun, handleIconClick } = useContext(ThemeContext);
  const [isExpanded, setIsExpanded] = useState(false);
  const [searchQuery, setSearchQuery] = useState("");
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const { userInformation, setUserInformation } = useContext(UserContext);
  const [cards, setCards] = useState([]);
  const [filteredCards, setFilteredCards] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchCards = async () => {
      setLoading(true);
      setError(null);

      try {
        const response = await axios.get("https://monkfish-app-z9uza.ondigitalocean.app/bcard2/cards");
        setCards(response.data);
        setFilteredCards(response.data);
      } catch (error) {
        console.error(error);
        setError("Error fetching cards. Please try again later.");
      }

      setLoading(false);
    };

    fetchCards();
  }, []);

  const handleSearchIconClick = () => {
    setIsExpanded(!isExpanded);
  };

  const handleLogout = () => {
    const confirmLogout = window.confirm("Are you sure you want to log out?");
    if (confirmLogout) {
      setUserInformation(null);
      localStorage.removeItem("userInformation");
      localStorage.removeItem("token");
      navigate("/");
      toast.success("Logged out successfully");
    }
  };

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  const handleSearchInputChange = (event) => {
    const query = event.target.value;
    setSearchQuery(query);
    if (query === "") {
      setFilteredCards(cards);
    } else {
      setFilteredCards(
        cards.filter((card) =>
          card.title.toLowerCase().includes(query.toLowerCase())
        )
      );
    }
  };

  return (
    <header className="header">
      <nav className={`container_nav ${isSun ? "dark" : "light"}`}>
        <img className="logo" src={Jobs} alt="jobs" />

        <div className="hamburger" onClick={toggleMenu}>
          <MenuIcon />
        </div>

        <ul className={`link_list ${isMenuOpen ? "open" : ""}`}>
          {userInformation?.isAdmin && (
            <>
              <li>
                <Link className="link" to={"/"}>
                  About
                </Link>
              </li>
              <li>
                <Link className="link" to={"/FindTheOne"}>
                  FindTheOne
                </Link>
              </li>
              <li>
                <Link className="link" to={"/favCards"}>
                  Favorite Cards
                </Link>
              </li>
              <li>
                <Link className="link" to={"/myCards"}>
                  My Cards
                </Link>
              </li>
              <li>
                <Link className="link" to={"/sandBox"}>
                  SandBox
                </Link>
              </li>
            </>
          )}
          {userInformation?.isBusiness && (
            <>
              <li>
                <Link className="link" to={"/"}>
                  About
                </Link>
              </li>
              <li>
                <Link className="link" to={"/FindTheOne"}>
                  FindTheOne
                </Link>
              </li>
              <li>
                <Link className="link" to={"/myCards"}>
                  My Cards
                </Link>
              </li>
            </>
          )}
          {!userInformation?.isAdmin && !userInformation?.isBusiness && userInformation && (
            <>
              <li>
                <Link className="link" to={"/"}>
                  About
                </Link>
              </li>
              <li>
                <Link className="link" to={"/FindTheOne"}>
                  FindTheOne
                </Link>
              </li>
            </>
          )}
          {!userInformation && !userInformation?.isAdmin && !userInformation?.isBusiness && (
            <li>
              <Link className="link" to={"/"}>
                About
              </Link>
            </li>
          )}
          <li>
            {userInformation ? (
              <button className="link " onClick={handleLogout}>
                Logout
              </button>
            ) : (
              <Link className="link" to={"/register"}>
                Register
              </Link>
            )}
          </li>

          <div className="moveRight">
            <li>
              <div className="searchBar">
                <input
                  className={isExpanded ? "expanded searchInput" : "searchInput"}
                  type="text"
                  placeholder="Search Your Card..."
                  value={searchQuery}
                  onChange={handleSearchInputChange}
                />
                <img
                  src={SearchIcon}
                  alt="Search Icon"
                  onClick={handleSearchIconClick}
                  className={isExpanded ? "searchIcon searchIconMoved" : "searchIcon"}
                />
              </div>
            </li>
            <li>
              <img
                src={isSun ? SunIcon : MoonIcon}
                alt="Sun Icon"
                onClick={handleIconClick}
                className="moon_sun_icon"
              />
            </li>
          </div>
        </ul>
      </nav>

      <div className="bodyFindTheOne">
        {loading ? (
          <Loading />
        ) : error ? (
          <div>Error: {error}</div>
        ) : (
          <div className={styleFindTheOne.container_cards}>
            <div className={styleFindTheOne.frontCard}>
              <h1>Cards</h1>
              <ul className={styleFindTheOne.listOfCards}>
                {filteredCards.map((card) => (
                  <li className={styleFindTheOne.item} key={card._id}>
                    <img
                      className={styleFindTheOne.imgCards}
                      src={card.image.url}
                      alt={card.image.alt}
                    />
                    <h2>{card.title}</h2>
                    <p className={styleFindTheOne.p}>{card.subtitle}</p>
                    <p className={styleFindTheOne.p}>{card.address.country}</p>
                    <div onClick={() => handleLike(card._id)}>
                      {card.liked ? (
                        <FavoriteIcon style={{ color: "red" }} />
                      ) : (
                        <FavoriteBorderIcon />
                      )}
                    </div>
                  </li>
                ))}
              </ul>
            </div>
          </div>
        )}
      </div>
    </header>
  );
};

export default NavBar;
